node.text:
Aw man! Got smoked yesterday 😮‍💨😂 still haven’t hit the sweet spot and on tracks like this it shows! It requires so much confidence and commitment, two things I have battled with a lot this year and only comes in waves… That’s ok though! Can’t force something like this but we’re working on it. 
Couple of changes to the track (new sections but my nemesis rock garden still present 😑😂😭) and we start Race 2 today with practice. Great opportunity to go at it again, face my fears and work on my weaknesses!!! Let’s go💪🏻💪🏻💪🏻💞💞💞

@danhearn & @point1athletic
